import React from 'react';
import { StyleSheet, Text, View, FlatList, ScrollView, Alert, Picker } from 'react-native';

export default class Homescreen extends React.Component {
  constructor(props) {
    super(props)
    this.state = { set: 'default' }
  }

  static navigationOptions = {
    title: 'Choose a Set'
  };

  handleChange = (set) => {
    const { navigate } = this.props.navigation;
    this.setState({ set: set }, () => {      
      navigate('Set', { set: sets[this.state.set] })
    })
  }

  render() {
    return (
      <View style={styles.container}>
        <Text style={[styles.header, styles.bold]}>Welcome to Rivals of Ixalan</Text>
        <Picker
          style={{ flex: 1, height: 600 }}
          selectedValue={this.state.set}
          onValueChange={this.handleChange.bind(this)}>
          <Picker.Item style={{ flex: 1 }} label="Choose a Set" value="default" 
                        enabled="false" />
          {
            sets.map(
              (set, idx) => <Picker.Item key={set.name} style={{ flex: 1 }} label={set.name} value={idx} />
            )
          }
        </Picker>
      </View>
    );
  }
}

